import React from "react";
import "./WordList.scss";
import ButtonDel from "../Buttons/ButtonDelete";
import InputForWord from "../InputWordListAdd/Input";
import ButtonAdd from "../Buttons/ButtonAdd";

function WordList(props) {
  return (
    <div className="table">
      <table>
        <caption className="table-name">Words List</caption>
        <thead>
          <InputForWord />
          <ButtonDel />
          <ButtonAdd />
          <tr>
            <th className="col">Word</th>
            <th className="col">Transcription</th>
            <th className="col">Translation</th>
          </tr>
        </thead>
        <tbody>
          <tr>
            <td>
              words.map((word)=>
              <Card
                key={word.id}
                word={word.english}
                transcription={word.transcription}
                translation={word.russian}
              ></Card>
              )
            </td>
            <td>Ячейка 2</td>
            <td>Ячейка 3</td>
          </tr>
        </tbody>
      </table>
    </div>
  );
}
export default WordList;
